import React from 'react'
import './ErrorPage.css'

function ErrorPage() {
  return (
    <div className='h1-container'>
      <h1 className='h1'>Oops!</h1>
      <h1 className='h1'>We've encountered a problem.</h1>
      <h1 className='h1'>Please contact our software developers.</h1>
    </div>
  )
}

export default ErrorPage
